import React from 'react';
import '../../styles/Tipografias.css';



class Ancleperfil extends React.Component {
    render() {
        return (
            <div className="row justify-content-center">
            <a className="AncleIconos" href="/">Actualizar</a>
            </div>
        )
    }
}
export default Ancleperfil;
